import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Card, Button } from "react-bootstrap";

export default class Explore extends Component {
  Hobbies = () => {
    return (
      <>
        <div>
          <h3>Hobbies</h3>
          <hr></hr>
        </div>
        <div>
          <img src={require("../pic/movie.png")} alt="Snow" />
        </div>
      </>
    );
  };

  render() {
    return (
      <div>
        <this.Hobbies />

        <div></div>
      </div>
    );
  }
}
